d in ihrer Eigenschaft als Mitglied auch keine sonstigen Zuwendungen aus Mitteln des Vereins (\\u00a72 der Vereinssatzung).<br \\/> <br \\/> <strong>Mitglieder des Lenkerbecker Erholungsvereins sind zur Zeit:<\\/strong><br \\/> Pfr. Ulrich M\\u00fcller, 1. Vorsitzender<br \\/> August Kl\\u00e4ne, 2. Vorsitzender<br \\/> Norbert Seme, Rechnungsf\\u00fchrer<br \\/> <br \\/> Werner D\\u00fcnheuft, Bruno Haupt, Marco Kl\\u00e4ne,&nbsp;Gregor Kranz, R\\u00fcdiger Kentrup, Michael Sawadski,&nbsp;<br \\/> Uwe Wegener, Patrick Wurmsee, G\\u00fcnther Mein, Ulf Feldhege, Friedhelm Wei\\u00df und Detlef Pantf\\u00f6rder.<br \\/> <br \\/> Die Vereinsmitglieder treffen sich an jedem<br \\/> 1. Dienstag des Monats im Pfarrzentrum<br \\/> St. Marien, H\\u00fclsbergstra\\u00dfe 167 in 45772 Marl.<br \\/> Die Versammlung beginnt um 17.00 Uhr.<br \\/> Neue Mitglieder sind jederzeit herzlich willkommen.<\\/p>\"},\"newRecord\":{\"bodytext\":\"<p><strong>Am 19. Juni 1966&nbsp;<\\/strong>wurde der Verein Lenkerbecker Erholungswerk Schlo\\u00df Holte e.V. gegr\\u00fcndet.<br \\/> <br \\/> <strong>Aufgaben des Vereins<\\/strong><br \\/> <br \\/> Der Verein leitet und verwaltet das Haus \\u201eMarienm\\u00fcnster\\u201d in 33758 Schlo\\u00df Holte-Stukenbrock - Kreis Wiedenbr\\u00fcck, Ortsteil Liemke, M\\u00fcnsterweg 42 - als Familien-, Jugend- und Seniorenerholungsheim sowie als Schullandheim. Der Verein dient ausschlie\\u00dflich und unmittelbar gemeinn\\u00fctzigen Zwecken. Jeder dar\\u00fcber hinaus gehende wirtschaftliche Gesch\\u00e4ftsbetrieb ist ausgeschlossen. Etwaige Gewinne d\\u00fcrfen nur f\\u00fcr die satzungsgem\\u00e4\\u00dfen Zwecke verwandt werden. Die Mitglieder erhalten keine Gewinnanteile und in ihrer Eigenschaft als Mitglied auch keine sonstigen Zuwendungen aus Mitteln des Vereins (\\u00a72 der Vereinssatzung).<br \\/> <br \\/> <strong>Mitglieder des Lenkerbecker Erholungsvereins sind zur Zeit:<\\/strong><br \\/> Pfr. Ulrich M\\u00fcller, 1. Vorsitzender<br \\/> Augu