aige Gewinne d\\u00fcrfen nur f\\u00fcr die satzungsgem\\u00e4\\u00dfen Zwecke verwandt werden. Die Mitglieder erhalten keine Gewinnanteile und in ihrer Eigenschaft als Mitglied auch keine sonstigen Zuwendungen aus Mitteln des Vereins (\\u00a72 der Vereinssatzung).<br \\/> <br \\/> <strong>Mitglieder des Lenkerbecker Erholungsvereins sind zur Zeit:<\\/strong><br \\/> Pfr. Ulrich M\\u00fcller, 1. Vorsitzender<br \\/> August Kl\\u00e4ne, 2. Vorsitzender<br \\/> August Kl\\u00e4ne, Rechnungsf\\u00fchrer (kommissarisch)<br \\/> <br \\/> Werner D\\u00fcnheuft, Bruno Haupt, Marco Kl\\u00e4ne,&nbsp;Gregor Kranz, R\\u00fcdiger Kentrup, Michael Sawadski,&nbsp;<br \\/> Uwe Wegener, Patrick Wurmsee, G\\u00fcnther Mein, Ulf Feldhege, Friedhelm Wei\\u00df und Detlef Pantf\\u00f6rder.<br \\/> <br \\/> Die Vereinsmitglieder treffen sich an jedem<br \\/> 1. Dienstag des Monats im Pfarrzentrum<br \\/> St. Marien, H\\u00fclsbergstra\\u00dfe 167 in 45772 Marl.<br \\/> Die Versammlung beginnt um 17.00 Uhr.<br \\/> Neue Mitglieder sind jederzeit herzlich willkommen.<\\/p>\"},\"newRecord\":{\"bodytext\":\"<p><strong>Am 19. Juni 1966&nbsp;<\\/strong>wurde der Verein Lenkerbecker Erholungswerk Schlo\\u00df Holte e.V. gegr\\u00fcndet.<br \\/> <br \\/> <strong>Aufgaben des Vereins<\\/strong><br \\/> <br \\/> Der Verein leitet und verwaltet das Haus \\u201eMarienm\\u00fcnster\\u201d in 33758 Schlo\\u00df Holte-Stukenbrock - Kreis Wiedenbr\\u00fcck, Ortsteil Liemke, M\\u00fcnsterweg 42 - als Familien-, Jugend- und Seniorenerholungsheim sowie als Schullandheim. Der Verein dient ausschlie\\u00dflich und unmittelbar gemeinn\\u00fctzigen Zwecken. Jeder dar\\u00fcber hinaus gehende wirtschaftliche Gesch\\u00e4ftsbetrieb ist ausgeschlossen. Etwaige Gewinne d\\u00fcrfen nur f\\u00fcr die satzungsgem\\u00e4\\u00dfen Zwecke verwandt werden. Die Mitglieder erhalten keine Gewinnanteile und in ihrer Eigenschaft als Mitglied auch keine sonstigen Zuwendungen aus Mitteln des Vereins (\\u00a72 der Vereinssatzung).<br \\/> <br \\/> <strong>Mitglieder des Lenkerbecker Erholungsvereins sind zur Zeit:<\\/strong><br \\/> Pfr. Ulrich M\\u00fcller, 1. Vorsitzender<br \\/> August Kl\\u00e4ne, 2. Vorsitzender<br \\/> Brigitte&nbsp;Kentrup, Rechnungsf\\u00fchrung<br \\/> <br \\/> Jutta und Werner D\\u00fcnheuft, Bruno Haupt, Marco Kl\\u00e4ne,&nbsp;Gregor Kranz, Brigitte und R\\u00fcdiger Kentrup, Michael Sawadski,&nbsp;<br \\/> Uwe Wegener, Martina und G\\u00fcnther Mein, Ulf Feldhege, Friedhelm Wei\\u00df und Detlef Pantf\\u00f6rder.<br \\/> <br \\/> Die Vereinsmitglieder treffen sich an jedem<br \\/> 1. Dienstag des Monats im Pfarrzentrum<br \\/> St. Marien, H\\u00fclsbergstra\\u00dfe 167 in 45772 Marl.<br \\/> Die Versammlung beginnt um 17.00 Uhr.<br \\/> Neue Mitglieder sind jederzeit herzlich willkommen.<\\/p>\"}}',0),(25,0,1625750620,2,'BE',4,0,47,'sys_file_reference','{\"oldRecord\":{\"hidden\":0},\"newRecord\":{\"hidden\":\"1\"}}',0),(26,0,1625750620,2,'BE',4,0,48,'sys_file_reference','{\"oldRecord\":{\"hidden\":0},\"newRecord\":{\"hidden\":\"1\"}}',0),(27,0,1625750736,1,'BE',4,0,124,'sys_file_reference','{\"uid\":124,\"pid\":16,\"tstamp\":1625750736,\"crdate\":1625750736,\"cruser_id\":4,\"deleted\":0,\"hidden\":0,\"sys_language_uid\":0,\"l10n_parent\":0,\"l10n_state\":null,\"l10n_diffsource\":\"\",\"t3ver_oid\":0,\"t3ver_id\":0,\"t3ver_label\":\"\",\"t3ver_wsid\":0,\"t3ver_state\":0,\"t3ver_stage\":0,\"t3ver_count\":0,\"t3ver_tstamp\":0,\"t3ver_move_id\":0,\"uid_local\":116,\"uid_foreign\":0,\"tablenames\":\"\",\"fieldname\":\"\",\"sorting_foreign\":0,\"table_local\":\"sys_file\",\"title\":null,\"description\":null,\"alternative\":null,\"link\":\"\",\"crop\":\"\",\"autoplay\":0}',0),(28,0,1625751126,2,'BE',4,0,23,'tt_content','{\"oldRecord\":{\"bodytext\":\"<p>Eine besondere und gern genutzte Attraktion ist das hauseigene Freischwimmbecken. Es ist 10 x 25 m gro\\u00df und hat eine Tiefe von 0,6m - 1,2 m. <strong>Das Schwimmbecken ist ge\\u00f6ffnet vom 15. Mai bis 15. S