itle\":null,\"description\":null,\"alternative\":null,\"link\":\"\",\"crop\":\"\",\"autoplay\":0}',0),(92,0,1625754626,2,'BE',4,0,15,'tt_content','{\"oldRecord\":{\"assets\":10},\"newRecord\":{\"assets\":9}}',0),(93,0,1625754626,2,'BE',4,0,144,'sys_file_reference','{\"oldRecord\":{\"l10n_diffsource\":\"\"},\"newRecord\":{\"l10n_diffsource\":\"a:3:{s:9:\\\"uid_local\\\";N;s:6:\\\"hidden\\\";N;s:16:\\\"sys_language_uid\\\";N;}\"}}',0),(94,0,1625754626,4,'BE',4,0,134,'sys_file_reference',NULL,0),(95,0,1625755341,2,'BE',4,0,35,'tt_content','{\"oldRecord\":{\"bodytext\":\"<p>Sie sind Gast in unserem Haus Marienm\\u00fcnster und sollen sich hier wohlf\\u00fchlen.<br \\/> Als Gast hat man, besonders in einer Gemeinschaft, aufeinander R\\u00fccksicht zu nehmen, sich anzupassen und Pflichten einzuhalten, die dem Zusammenleben dienen.<br \\/> In dieser \\u201eHausordnung\\u201c haben wir f\\u00fcr den reibungslosen Betrieb einige Punkte erfa\\u00dft und bitten um Beachtung und Einhaltung.<\\/p>\\r\\n<ol> \\t<li>Dem Hausmeister ist die verantwortliche Gruppenleitung und die Anzahl der G\\u00e4ste anzugeben.<br \\/> \\t&nbsp;<\\/li> \\t<li>Die Gruppenleitung hat sich \\u00fcber die Sicherheitsvorschriften \\u201eWas tun, wenn es brennt?\\u201c zu&nbsp;informieren.<br \\/> \\t&nbsp;<\\/li> \\t<li>Unser Inventar ist pfleglich zu behandeln. Sch\\u00e4den sind dem Hausmeister sofort<br \\/> \\tzu melden. Es haftet die Gruppenleitung.<br \\/> \\t&nbsp;<\\/li> \\t<li>Aus Sicherheitsgr\\u00fcnden ist es den G\\u00e4sten untersagt, Keller-, W\\u00e4sche- und sonstige<br \\/> \\tLagerr\\u00e4ume zu betreten und an technischen Anlagen und Anlagenteilen zu hantieren.<br \\/> \\t&nbsp;<\\/li> \\t<li>In Abstimmung mit dem Hausmeister und der Gruppenleitung wird die Nutzung der einzelnen R\\u00e4ume festgelegt. Alle benutzten R\\u00e4ume sind besenrein zu halten und zu verlassen. Papierk\\u00f6rbe bzw. Abfallbeh\\u00e4lter sind t\\u00e4glich zu leeren.&nbsp;Auf Sortierung achten!<br \\/> \\t&nbsp;<\\/li> \\t<li>Schlafr\\u00e4ume<br \\/> \\tIn den Schlafr\\u00e4umen ist das Rauchen nicht gestattet.<br \\/> \\tBetten m\\u00fcssen grunds\\u00e4tzlich mit Bettw\\u00e4sche bezogen sein. Bettw\\u00e4sche ist in der Regel mitzubringen. Im Bedarfsfall kann sie beim Hausmeister gegen Entgelt entliehen werden.<br \\/> \\tAus hygienischen Gr\\u00fcnden bitten wir Sie, da\\u00df Bettzeug sowie die Matratzen nicht aus den Betten zu entfernen. Bitte nicht die als Schutz \\u00fcber die Matratzen gezogenen Bettlaken entfernen!<br \\/> \\t&nbsp;<\\/li> \\t<li>K\\u00fcche<br \\/> \\tAbf\\u00e4lle sind zu sortieren und in die entsprechenden M\\u00fcllgef\\u00e4\\u00dfe zu f\\u00fcllen.<br \\/> \\tMitgebrachte Lebensmittel, die nicht gebraucht wurden, m\\u00fcssen wieder mitgenommen werden.<br \\/> \\t&nbsp;<\\/li> \\t<li>Schwimmbad<br \\/> \\tDie Benutzung des Schwimmbades ist mit dem Hausmeister abzustimmen.<br \\/> \\tBetreten wird das Schwimmbad nur durch das Fu\\u00dfbecken.<br \\/> \\tSpringen vom Beckenrand ist untersagt.<br \\/> \\tVor Betreten des Bades sind die Duschen zu benutzen.<br \\/> \\t&nbsp;<\\/li> \\t<li>Aufenthalt auf dem Grundst\\u00fcck (Au\\u00dfenanlagen)<br \\/> \\tAus Brandschutzgr\\u00fcnden sind Lagerfeuer nicht erlaubt.<br \\/> \\tBallspiele bitte nur auf dem Grundst\\u00fcck hinter dem Haus durchf\\u00fchren.<br \\/> \\t&nbsp;<\\/li> \\t<li>In der K\\u00fcche befindet sich ein Telefon f\\u00fcr den Notfall.<br \\/> \\tDas Internet k\\u00f6nnen Sie per&nbsp; WLAN nutzen. Die Geb\\u00fchr entnehmen Sie der g\\u00fcltigen<br \\/> \\tPreisliste. Den Key-Cod bekommen Sie beim Hausmeister.<br \\/> \\t&nbsp;<\\/li> \\t<li>Schutz vor L\\u00e4rm<br \\/> \\tIn der Zeit von 22 Uhr bis 8 Uhr ist die von uns vorgegebene Nachtruhe im Freien (Spielwiese, Pool usw.) einzuhalten. Unsere Nachbarn werden Ihnen sehr dankbar sein. Nat\\u00fcrlich ist Radio, CD-Spieler und Fernsehen in Zimmerlautst\\u00e4rke erlaubt.<\\/li> <\\/ol>\\r\\n<p>Wir w\\u00fcnschen unseren G\\u00e4sten trotzt dieser notwendigen Auflagen frohe Stunden im Haus Marienm\\u00fcnster.<\\/p>\\r\\n<p>Unser Personal wird Ihnen jederzeit behilflich sein.<\\/p>\"},\"newRecord\":{\"bodytext\":\"<p>Sie sind Gast in unserem Haus Marienm\\u00fcnster und sollen sich hier wohlf\\u00fchlen.<br \\/> Als Gast hat man, besonders in einer Gemeinschaft, aufeinander R\\u00fccksicht zu nehmen, sich anzupassen und Pflichten einzuhalten, die dem Zusammenleben dienen.<br \\/> In dieser \\u201eHausordnung\\u201c haben wir f\\u00fcr den reibungslosen Betrieb einige Punkte erfa\\u00dft und bitten um Beachtung und Einhaltung.<\\/p>\\r\\n<ol> \\t<li>Dem Hausmeister ist die verantwortliche Gruppenleitung und die Anzahl der G\\u00e4ste anzugeben.<br \\/> \\t&nbsp;<\\/li> \\t<li>Die Gruppenleitung hat sich \\u00fcber die Sicherheitsvorschriften \\u201eWas tun, wenn es brennt?\\u201c zu&nbsp;informieren.<br \\/> \\t&nbsp;<\\/li> \\t<li>Unser Inventar ist pfleglich zu behandeln. Sch\\u00e4den sind dem Hausmeister sofort<br \\/> \\tzu melden. Es haftet die Gruppenleitung.<br \\/> \\t&nbsp;<\\/li> \\t<li>Aus Sicherheitsgr\\u00fcnden ist es den G\\u00e4sten untersagt, Keller-, W\\u00e4sche- und sonstige<br \\/> \\tLagerr\\u00e4ume zu betreten und an technischen Anlagen und Anlagenteilen zu hantieren.<br \\/> \\t&nbsp;<\\/li> \\t<li>In Abstimmung mit dem Hausmeister und der Gruppenleitung wird die Nutzung der einzelnen R\\u00e4ume festgelegt. Alle benutzten R\\u00e4ume sind besenrein zu halten und zu verlassen. Papierk\\u00f6rbe bzw. Abfallbeh\\u00e4lter sind t\\u00e4glich zu leeren.&nbsp;Auf Sortierung achten!<br \\/> \\t&nbsp;<\\/li> \\t<li>Schlafr\\u00e4ume<br \\/> \\tIn den Schlafr\\u00e4umen ist das Rauchen nicht gestattet (vernetzte Rauchmelder!)<br \\/> \\tBetten m\\u00fcssen grunds\\u00e4tzlich mit Bettw\\u00e4sche bezogen sein. Bettw\\u00e4sche ist in der Regel mitzubringen. Im Bedarfsfall kann sie beim Hausmeister gegen Entgelt entliehen werden.<br \\/> \\tAus hygienischen Gr\\u00fcnden bitten wir Sie, da\\u00df Bettzeug sowie die Matratzen nicht aus den Betten zu entfernen. Bitte nicht die als Schutz \\u00fcber die Matratzen gezogenen Bettlaken entfernen!<br \\/> \\t&nbsp;<\\/li> \\t<li>K\\u00fcche<br \\/> \\tAbf\\u00e4lle sind zu sortieren und in die entsprechenden M\\u00fcllgef\\u00e4\\u00dfe zu f\\u00fcllen.<br \\/> \\tMitgebrachte Lebensmittel, die nicht gebraucht wurden, m\\u00fcssen wieder mitgenommen werden.<br \\/> \\t&nbsp;<\\/li> \\t<li>Schwimmbad<br \\/> \\tDie Benutzung des Schwimmbades ist mit dem Hausmeister abzustimmen.<br \\/> \\tBetreten wird das Schwimmbad nur durch das Fu\\u00dfbecken.<br \\/> \\tSpringen vom Beckenrand ist untersagt.<br \\/> \\tVor Betreten des Bades sind die Duschen zu benutzen.<br \\/> \\t&nbsp;<\\/li> \\t<li>Aufenthalt auf dem Grundst\\u00fcck (Au\\u00dfenanlagen)<br \\/> \\tAus Brandschutzgr\\u00fcnden sind Lagerfeuer nur an der Feuerstelle, bzw. Feuerschale im kleinen Rahmen erlaubt. Bitte nicht unbeobachtet lassen und das Feuer sp\\u00e4ter&nbsp;abl\\u00f6schen!<br \\/> \\tBallspiele bitte nur auf dem Grundst\\u00fcck hinter dem Haus durchf\\u00fchren.<br \\/> \\t&nbsp;<\\/li> \\t<li>In der K\\u00fcche befindet sich ein Telefon f\\u00fcr den Notfall.<br \\/> \\tDas Internet k\\u00f6nnen Sie per&nbsp;WLAN nutzen. Den WLAN Schl\\u00fcssel bekommen sie bei der Anmeldung oder vor Ort beim Hausmeister.<br \\/> \\t&nbsp;<\\/li> \\t<li>Schutz vor L\\u00e4rm<br \\/> \\tIn der Zeit von 22 Uhr bis 8 Uhr ist die von uns vorgegebene Nachtruhe im Freien (Spielwiese, Pool usw.) einzuhalten. Unsere Nachbarn werden Ihnen sehr dankbar sein. Nat\\u00fcrlich ist Radio, CD-Spieler und Fernsehen in Zimmerlautst\\u00e4rke erlaubt.<\\/li> <\\/ol>\\r\\n<p>Wir w\\u00fcnschen unseren G\\u00e4sten trotzt dieser notwendigen Auflagen frohe Stunden im Haus Marienm\\u00fcnster.<\\/p>\\r\\n<p>Unser Personal wird Ihnen jederzeit behilflich sein.<\\/p>\"}}',0),(96,0,1629040589,2,'BE',4,0,34,'tt_content','{\"oldRecord\":{\"bodytext