ätze in Ein-, Zwei-, Vier- und Fünfbettzimmern und eignet sich besonders für Schulklassen oder Gruppen.<br /> Die Zweibettzimmer sind als Doppelbettzimmer, und die Vier- und Fünfbettzimmer sind mit Etagenbetten<br /> ausgestattet.<br /> In fast allen Zimmern sind separate Waschgelegenheiten vorhanden. Im Erdgeschoss befindet sich ein Duschraum mit drei separaten Nasszellen.</p>',0,0,0,9,0,0,8,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',1,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(16,'',12,1572448105,1539717749,1,0,0,0,0,'',256,0,0,0,0,NULL,0,'a:4:{s:5:\"CType\";N;s:6:\"header\";N;s:8:\"bodytext\";N;s:6:\"assets\";N;}',0,0,'',0,0,0,0,0,0,'textmedia','Erdgeschoss','','<p><em>rechts</em><br /> Hausmeisterraum, dahinter Putzraum<br /> Nr. 1 &gt; 2 Etagenbetten 4 Personen (mit Waschgelegenheit)<br /> Nr. 2 &gt; 2 Etagenbetten 4 Personen (mit Waschgelegenheit)<br /> Nr. 3 &gt; 1 Doppelzimmer 2 Personen (mit Waschgelegenheit)<br /> Nr. 4 &gt; 2 Etagenbetten 4 Personen (mit Waschgelegenheit)<br /> Nr. 5 &gt; 2 Etagenbetten 4 Personen (mit Waschgelegenheit)<br /> Nr. 6 &gt; 2 Etagenbetten 4 Personen (mit Waschgelegenheit)<br /> <br /> <em>links</em><br /> Duschraum mit 3 Duschkabinen<br /> Herrentoilette, 1 WC abgetrennt, 2 Urinale, 1 Waschbecken<br /> Damentoilette, 1 WC abgetrennt, 2 Waschbecken</p>',0,0,0,1,0,0,0,1,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'Zimmereinteilung (22 Schlafplätze)','',1,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(17,'',13,1546092085,1539718282,1,0,0,0,0,'',256,0,0,0,0,NULL,0,'a:30:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:6:\"assets\";N;s:11:\"imageorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,'',0,0,0,0,0,0,'textmedia','Obergeschoss','','<p><em>rechts </em><br /> 2 Toiletten, 1 Urinal abgetrennt, 2 Waschbecken<br /> 1 Toilette, 1 Dusche (Zur Zeit Außerbetrieb)&nbsp;<br /> 4 Stufen zu den Räumen 9, 10 und 11<br /> Nr. 9 &gt; 1 Doppelzimmer 2 Personen (mit Waschgelegenheit)<br /> Nr. 10 &gt; 1 Doppelzimmer 2 Personen (mit Waschgelegenheit)</p>\r\n<p><em>links</em><br /> Nr. 7 &gt; 3 Einzelbetten, 1 Etagenbett 5 Personen (ohne Waschgelegenheit)<br /> Nr. 8 &gt; 2 Etagenbetten, 1 Einzelbett 5 Personen (ohne Waschgelegenheit)<br /> Nr. 11&nbsp;&gt; 1 Einzelzimmer mit Schreibtisch 1 Person (mit Waschgelegenheit)</p>',0,0,0,1,0,0,0,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'Zimmereinteilung (15 Schlafplätze)','',1,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(18,'',14,1572871584,1539718405,1,0,0,0,0,'',256,0,0,0,0,NULL,0,'a:30:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:6:\"assets\";N;s:11:\"imageorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,'',0,0,0,0,0,0,'textmedia','Nebengebäude','','<p>Das Nebengebäude verfügt über einen Aufenthaltsraum mit SAT-TV und WLAN&nbsp; (WLAN auch im Haupthaus), er bietet Sitzgelegenheit für 37 Personen.</p>\r\n<p>Im Außenbereich befinden sich weitere Sitzgelegenheiten auf der Terrasse.</p>\r\n<p>Die gut eingerichtete Küche im Nebengebäude bietet einwandfreie Geräte zur Selbstversorgung.<br /> <br /> Der Gast findet in der Küche einen großen Küchenherd, einen kleinen Küchenherd, eine Industrie-Spülmaschine, eine große Schwenkpfanne, eine Friteuse, einen großen Toaster sowie alle Küchengeräte die gebraucht werden: Mixer, Stabmixer, Kaffeemaschine und Wasserkocher. Kuchen können mit unseren Backformen gebacken werden.<br /> <br /> Im Vorraum befinden sich zwei große Kühlschränke sowie ein Tiefkühlschrank.<br /> Der Vorraum und die Küchenschränke bieten genug Stauraum. Auch an unsere kleinen Gäste ist gedacht, es befinden sich Flaschenwärmer im Küchenschrank.</p>',0,0,0,6,0,0,8,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'Moderne Ausstattung für 37 Personen','',1,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(19,'',5,1555577128,1539718489,1,0,0,0,0,'',256,0,0,0,0,NULL,0,'a:30:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\