'','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(27,'',7,1539719419,1539719419,1,0,0,0,0,'',512,0,0,0,0,NULL,0,'',0,0,'',0,0,0,0,0,0,'textmedia','Aufzählung','','<p><strong><a href=\"http://www.schloss-holte-stukenbrock.de/\">&gt; Schloß Holte-Stukenbrock - Quellort der Ems</a></strong><br /> Klein und quirlig kommt sie aus mehreren Quellen aus dem sumpfigen Boden, um rasch ein kleines Bächlein zu werden, der als breiter Strom nach 371 km in die Nordsee mündet. Die Ems - eine (un)bekannte Schönheit.<br /> <br /> <strong>&gt;</strong>&nbsp;<strong><a href=\"http://safaripark-stukenbrock.de/\">Hollywood- und Safaripark Stukenbrock-Senne</a></strong><br /> Am Rande der Senne liegt ein Stück Afrika.<br /> <br /> <strong>&gt;</strong>&nbsp;<strong><a href=\"http://www.adlerwarte-berlebeck.de/\">Adlerwarte Berlebeck</a></strong><br /> Älteste und artenreichste Greifenvogelwarte Europas.&nbsp;Neben einer Vielzahl an heimischen und exotischen Greifvögeln sieht man Geier aus aller Welt, unter anderem auch den größten Vogel der Erde, den Andenkondor mit einer Flügelspannweite von 3,30 m.&nbsp;Zwischen dem 1. März und 15. November finden täglich Freiflugvorführungen statt.<br /> <br /> <strong>&gt;</strong>&nbsp;<strong><a href=\"http://www.externsteine.de/\">Externsteine</a></strong><br /> Westlich von Horn-Bad Meinberg, im Naturpark Eggegebirge und südlicher Teutoburger Wald, liegen die geheimnisumwitterten Externsteine, eines der bedeutendsten Kultur- und Naturdenkmäler der Region.<br /> <br /> <strong>&gt;&nbsp;</strong><strong><a href=\"http://www.hermannsdenkmal.de/\">Hermannsdenkmal</a></strong><br /> Mitte des 19. Jh. von Ernst von Bandel auf einem Hochplateau bei Detmold erbaut, erinnert das imposante Hermannsdenkmal an die Schlacht im Teutoburger Wald im Jahre 9 n. Chr.&nbsp;Das Hermannsdenkmal ist eines der bedeutendsten Ausflugsziele des gesamten nordwestdeutschen Raumes.<br /> <br /> <strong>&gt;&nbsp;</strong><a href=\"http://www.schloss-holte-stukenbrock.de/\"><strong>Weitere Informationen und Tipps finden Sie hier:</strong><br /> <em>http://www.schloss-holte-stukenbrock.de</em></a><br /> <br /> <strong>&gt;&nbsp;</strong><a href=\"http://www.schloss-holte-stukenbrock.de/\"><strong>Klinken Sie sich ein in das Abenteuer \"Teuto-Kletterpark\":</strong></a><br /> Meistern Sie in verschiedenen Schwierigkeitsstufen überraschende Kletter- und Balanceaufgaben und bewegen Sie sich gesichert durch eine Welt aus Tauen, Balken und Plattformen.<br /> Mehr unter:&nbsp;<a href=\"http://www.interakteam.de/index.php?structid=17\"><em>http://www.interakteam.de/index.php?structid=17</em></a><br /> <br /> <strong>&gt;&nbsp;<a href=\"http://www.stadtdetmold.de/4218.0.html?&amp;L=00379\">LWL - Freilichtmuseum Detmold</a></strong><br /> Detmold heißt Sie willkommen im größten Freilichtmuseum Europas! Auf über 100 ha zeigen mehr als 90 vollständig eingerichtete Gebäude aus allen Landschaften Westfalens den geschichtlichen Hintergrund ländlichen Bauens. Zwischen Eingangsbereich und dem \"Paderborner Dorf\" verkehren Pferdewagen auf dem Museumsgelände, auf dem auch drei urige Lokale die Besucher zum Rasten und Stärken einladen. Täglich wird altes Handwerk wie Mehl Mahlen, Schmieden, Töpfern usw. demonstriert.<br /> Mehr unter:<em>&nbsp;<a href=\"http://www.lwl.org/freilichtmuseum-detmold/01_startseite.php\">http://www.lwl.org/freilichtmuseum-detmold/01_startseite.php</a></em></p>\r\n\r\n',0,0,0,0,0,0,0,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',0,'100','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(28,'',8,1625751485,1539719537,1,0,0,0,0,'',256,0,0,0,0,NULL,0,'a:30:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:6:\"assets\";N;s:11:\"imageorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,'',0,0,0,0,0,0,'textmedia','Fotogalerie','','',0,0,0,8,0,0,8,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',1,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-