3:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,'',0,0,0,0,0,0,'header','Anmeldeformular','',NULL,0,0,0,0,0,0,0,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(33,'',6,1555577729,1539720206,1,0,0,0,0,'',256,0,0,0,0,NULL,0,'a:26:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,'',0,0,0,0,0,0,'text','Allgemeine Hinweise','','<p>• Die Belegung der Zimmer am Anreisetag ist ab 14.00 Uhr möglich. Für Schulklassen stehen die Zimmer bereits ab 10.00 Uhr zur Verfügung. Am Abreisetag bitten wir um die Räumung der Zimmer bis 10.00 Uhr.<br /> <br /> • Um Beachtung der aushängenden Hausordnung und der Sicherheitsvorschrift „Was tun wenn es brennt?“ wird gebeten.<br /> <br /> • Bettwäsche (Laken, Bett- und Kopfkissenbezug) kann privat mitgebracht werden oder gegen eine kleine Leihgebühr beim Hausmeister ausgeliehen werden.<br /> <br /> • Das Haus Marienmünster ist ein Selbstversorgerhaus. Das heißt, den Einkauf von Lebensmitteln wie auch das Kochen und Backen übernehmen Sie. Dazu steht Ihnen eine komplett ausgestattete Küche zur Verfügung. Geschirrtücher sind mitzubringen.<br /> <br /> • Für Fragen und Anliegen während Ihres Aufenthalts steht Ihnen gerne unser Hausmeister zur Seite.<br /> <br /> • Vom Mitbringen von Haustieren bitten wir abzusehen.<br /> <br /> • Über weitere Einzelheiten des Angebotes vor Ort, der Hausordnung, unserer Übernachtungspreise und der Zahlungsmodalitäten informiert sie Werner Dünheuft, der auch gerne Ihre Anmeldung entgegen nimmt &gt;&nbsp;<em><a href=\"t3://page?uid=9\">(Adresse s. Auskunft und Reservierung).</a></em></p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(34,'',18,1629041915,1539720412,1,0,0,0,0,'',256,0,0,0,0,NULL,0,'a:26:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,'',0,0,0,0,0,0,'text','Preisliste Haus Marienmünster','','<p><strong>Preise pro Tag und Übernachtung:</strong></p>\r\n<p><strong>Wir haben eine kleine Preisanpassung ab&nbsp;2022 vorgenommen.&nbsp; &nbsp;</strong></p>\r\n<p><strong>Neue Preise für Gruppen kleiner 15 Personen 300 Euro/Tag. Ab 15&nbsp;Personen dann 20 Euro/Tag.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Kinder bis 10 Jahre 10 Euro/Tag.</strong></p>\r\n<p><strong>Die Endreinigung wird zukünftig aus kostengründen ab 2022 auf 150 Euro angehoben. Dies sind&nbsp;die tätsächlich anfallenden Kosten der Reinigungsfirma.</strong></p>\r\n<p>&nbsp; &nbsp;</p>\r\n<table class=\"table\"> 	<tbody> 		<tr> 			<td>&gt; Gruppen kleiner als 15 Personen</td> 			<td>270,00 Euro</td> 		</tr> 		<tr> 			<td>&gt; ab 15 Personen</td> 			<td>18,00 Euro/Person</td> 		</tr> 		<tr> 			<td>&gt; Kinder bis zu einem Alter von 3 Jahren sind kostenfrei</td> 			<td>kostenfrei</td> 		</tr> 		<tr> 			<td>&gt; Kinder im Alter zwischen 3 und 6 Jahre</td> 			<td>9,00 Euro/Kind</td> 		</tr> 		<tr> 			<td>&gt; Bettwäsche</td> 			<td>5,00 Euro/Person</td> 		</tr> 		<tr> 			<td>&gt; Endreinigung</td> 			<td>75,00 Euro</td> 		</tr> 		<tr> 			<td> 			<p>&gt; Internetnutzung per WLan</p> 			<p>&gt; Stornierungskosten: 6 Wochen vor dem Buchungstermin</p> 			<p>&gt; Stornierungskosten: 4 Wochen vor dem Buchungstermin</p> 			</td> 			<td> 			<p>kostenlos</p> 			<p>135,00 Euro</p> 			<p>270,00 Euro</p> 			</td> 		</tr> 	</tbody> </table>\r\n<h2><br /> <span class=\"text-primary\"><strong><span class=\"text-info\"><span class=\"text-success\"><span class=\"text-secondary\">Unser Haus ist&nbsp;ganzjährig geöffnet.</span></span></span></strong></span></h2>',0,0,0,0,0,0,0,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'Stand Juli 2021','',0,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(35,'',19,1625755341,1539720491,1,0,0,0,0,'',256,0,0,0,0,NULL,0,'a:26:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,'',0,0,0,0,0,0,'text','Hausordnung','','<p>Sie sind Gast in unserem Haus Marienmünster und sollen sich hier wohlfühlen.<br /> Als Gast hat man, besonders in einer Gemeinschaft, aufeinander Rücksicht zu nehmen, sich anzupassen und Pflichten einzuhalten, die dem Zusammenleben dienen.<br /> In dieser „Hausordnung“ haben wir für den reibungslosen Betrieb einige Punkte erfaßt und bitten um Beachtung und Einhaltung.</p>\r\n<ol> 	<li>Dem Hausmeister ist die verantwortliche Gruppenleitung und die Anzahl der Gäste anzugeben.<br /> 	&nbsp;</li> 	<li>Die Gruppenleitung hat sich über die Sicherheitsvorschriften „Was tun, wenn es brennt?“ zu&nbsp;informieren.<br /> 	&nbsp;</li> 	<li>Unser Inventar ist pfleglich zu behandeln. Schäden sind dem Hausmeister sofort<br /> 	zu melden. Es haftet die Gruppenleitung.<br /> 	&nbsp;</li> 	<li>Aus Sicherheitsgründen ist es den Gästen untersagt, Keller-, Wäsche- und sonstige<br /> 	Lagerräume zu betreten und an technischen Anlagen und Anlagenteilen zu hantieren.<br /> 	&nbsp;</li> 	<li>In Abstimmung mit dem Hausmeister und der Gruppenleitung wird die Nutzung der einzelnen Räume festgelegt. Alle benutzten Räume sind besenrein zu halten und zu verlassen. Papierkörbe bzw. Abfallbehälter sind täglich zu leeren.&nbsp;Auf Sortierung achten!<br /> 	&nbsp;</li> 	<li>Schlafräume<br /> 	In den Schlafräumen ist das Rauchen nicht gestattet (vernetzte Rauchmelder!)<br /> 	Betten müssen grundsätzlich mit Bettwäsche bezogen sein. Bettwäsche ist in der Regel mitzubringen. Im Bedarfsfall kann sie beim Hausmeister gegen Entgelt entliehen werden.<br /> 	Aus hygienischen Gründen bitten wir Sie, daß Bettzeug sowie die Matratzen nicht aus den Betten zu entfernen. Bitte nicht die als Schutz über die Matratzen gezogenen Bettlaken entfernen!<br /> 	&nbsp;</li> 	<li>Küche<br /> 	Abfälle sind zu sortieren und in die entsprechenden Müllgefäße zu füllen.<br /> 	Mitgebrachte Lebensmittel, die nicht gebraucht wurden, müssen wieder mitgenommen werden.<br /> 	&nbsp;</li> 	<li>Schwimmbad<br /> 	Die Benutzung des Schwimmbades ist mit dem Hausmeister abzustimmen.<br /> 	Betreten wird das Schwimmbad nur durch das Fußbecken.<br /> 	Springen vom Beckenrand ist untersagt.<br /> 	Vor Betreten des Bades sind die Duschen zu benutzen.<br /> 	&nbsp;</li> 	<li>Aufenthalt auf dem Grundstück (Außenanlagen)<br /> 	Aus Brandschutzgründen sind Lagerfeuer nur an der Feuerstelle, bzw. Feuerschale im kleinen Rahmen erlaubt. Bitte nicht unbeobachtet lassen und das Feuer später&nbsp;ablöschen!<br /> 	Ballspiele bitte nur auf dem Grundstück hinter dem Haus durchführen.<br /> 	&nbsp;</li> 	<li>In der Küche befindet sich ein Telefon für den Notfall.<br /> 	Das Internet können Sie per&nbsp;WLAN nutzen. Den WLAN Schlüssel bekommen sie bei der Anmeldung oder vor Ort beim Hausmeister.<br /> 	&nbsp;</li> 	<li>Schutz vor Lärm<br /> 	In der Zeit von 22 Uhr bis 8 Uhr ist die von uns vorgegebene Nachtruhe im Freien (Spielwiese, Pool usw.) einzuhalten. Unsere Nachbarn werden Ihnen sehr dankbar sein. Natürlich ist Radio, CD-Spieler und Fernsehen in Zimmerlautstärke erlaubt.</li> </ol>\r\n<p>Wir wünschen unseren Gästen trotzt dieser notwendigen Auflagen frohe Stunden im Haus Marienmünster.</p>\r\n<p>Unser Personal wird Ihnen jederzeit behilflich sein.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'Stand: April 2019','',0,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(36,'',20,1572862307,1539720665,1,1,1,0,0,'',768,0,0,0,0,NULL,0,'a:1:{s:6:\"hidden\";N;}',0,0,'',0,0,0,0,0,0,'textmedia','Belegungsplan 2020','','<p>Klicken Sie für eine größere Ansicht oder zum Download auf den Belegungsplan.</p>',0,0,0,1,0,0,8,1,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(37,'',10,1539720810,1539720753,1,0,0,0,0,'',256,0,0,0,0,NULL,0,'a:30:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:6:\"assets\";N;s:11:\"imageorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;