trong>Mitglieder des Lenkerbecker Erholungsvereins sind zur Zeit:</strong><br /> Pfr. Ulrich Müller, 1. Vorsitzender<br /> August Kläne, 2. Vorsitzender<br /> Brigitte&nbsp;Kentrup, Rechnungsführung<br /> <br /> Jutta und Werner Dünheuft, Bruno Haupt, Marco Kläne,&nbsp;Gregor Kranz, Brigitte und Rüdiger Kentrup, Michael Sawadski,&nbsp;<br /> Uwe Wegener, Martina und Günther Mein, Ulf Feldhege, Friedhelm Weiß und Detlef Pantförder.<br /> <br /> Die Vereinsmitglieder treffen sich an jedem<br /> 1. Dienstag des Monats im Pfarrzentrum<br /> St. Marien, Hülsbergstraße 167 in 45772 Marl.<br /> Die Versammlung beginnt um 17.00 Uhr.<br /> Neue Mitglieder sind jederzeit herzlich willkommen.</p>',0,0,0,1,0,0,125,1,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',1,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(40,'',21,1546088711,1539720984,1,1,0,0,0,'',512,0,0,0,0,NULL,0,'',0,0,'',0,0,0,0,0,0,'text','Verstobene','','<p><strong>Verstorbene Mitglieder</strong><br /> Anton Ruenaufer<br /> *11.12.1916, +31.08.1996<br /> Marian Tarka,<br /> *08.04.1949, +19.10.2007<br /> Pfr. Rolf Heithoff,<br /> *22.05.1925, +30.12.2008<br /> Martin Chrobok,<br /> *17.01.1934, +30.10.2010<br /> Josef Moll,<br /> *14.10.1922, +14.11.2011<br /> Leo Korthaus,<br /> *25.03.1926, +18.10.2012<br /> Herbert Lechtenböhmer,<br /> *05.08.1944, +16.01.2014<br /> Franz Skupin,<br /> *03.03.1932, +08.03.2014</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',0,'100','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(41,'',20,1546854606,1546086005,2,1,0,0,0,'',512,0,0,0,0,NULL,0,'a:30:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:6:\"assets\";N;s:11:\"imageorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,'',0,0,0,0,0,0,'textmedia','Belegungsplan 2020','','',0,0,0,1,0,0,8,1,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(42,'',3,1546087312,1546086862,2,0,0,0,0,'',384,0,0,0,0,NULL,0,'a:30:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:8:\"bodytext\";N;s:6:\"assets\";N;s:11:\"imageorient\";N;s:9:\"imagecols\";N;s:10:\"image_zoom\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,'',0,0,0,0,0,0,'textmedia','Ein Blick auf die Anfänge des Erholungswerkes ist bestimmt genauso interessant wie das Jubiläum selbst.','','<p>Am 2. September 2006 feierte das „Lenkerbecker Erholungswerk Schloß Holte e. V.“, das zur Pfarrgemeinde St. Marien in Marl-Lenkerbeck gehört, sein 40-jähriges Bestehen. Ein Blick auf die Anfänge des Erholungswerkes ist bestimmt genauso interessant wie das Jubiläum selbst.<br /> <br /> Im November 1965 kam Heinrich Bücker, heute Pfarrer in Moers, als Religionslehrer nach Marl. Er war gleichzeitig Kaplan an der Kirche St. Marien in Marl-Lenkerbeck. Als Kaplan von Rheinhausen hatte er in seiner ostwestfälischen Heimat für Messdienerfreizeiten eine ehemalige Schule gemietet. Standort der Schule war der Ort Liemke, der heute zu Schloß Holte-Stukenbrock gehört. Als er Pfarrer Heithoff und der KAB von St. Marien Marl-Lenkerbeck von dem Haus erzählte, waren diese nach einer Besichtigung sofort interessiert, dieses Haus zu übernehmen, um ein Erholungsheim für Kinder daraus zu machen. Der zuständige Amtsdirektor von Werl, Klose, war mit der Übernahme einverstanden.<br /> <br /> Das Haus wurde zunächst gemietet und 1968 von der Gemeinde St. Marien Marl-Lenkerbeck gekauft. Unter Leitung der Lenkerbecker KAB wurde das Haus instand gesetzt. An den Samstagen fuhren die zahlreichen Helferinnen und Helfer nach Schloß Holte, um an der ehemaligen Bauernschaftsschule ehrenamtlich zu arbeiten. Es herrschte stets eine tolle Stimmung. Häufig waren Pfarrer oder Kaplan dabei, die ebenfalls keine Renovierungsarbeiten scheuten. Am 10. Februar 1969 wurde dem Verein Lenkerbecker Erholungswerk von der Kirchengemeinde St. Marien per Grundstücks-Überlassungsvertrag, das Grundstück sowie die darauf stehenden Gebäude, (ausschließlich zur gemeinnützigen Nutzung) kostenlos überlassen.<br /> <br /> 1967 wurde sogar ein Schwimmbecken gebaut. Die dafür benötigte Folie stiftete die „CWH“ (Chemische Werke Hüls AG), wie die heutige Degussa damals firmierte. Die erste Wasserfüllung wurde von der Schloßholter Feuerwehr geliefert. Das Wasser war eiskalt. Dennoch war Pfarrer Heithoff einer der ersten, der in das kalte Wasser stieg.<br /> <br /> Bleibt zu erwähnen, dass das Heim die Bezeichnung „Haus Marienmünster“ erhielt, weil das Kloster Marienmünster – ein Ort der Stille – nicht weit war, die Schule „Münsterteicher Schule“ und die neue Trägergemeinde St. Marien hieß. Schließlich sollte das Haus vor allem der Ruhe und Besinnung dienen.<br /> <br /> Eingeweiht wurde das Erholungsheim mit der ersten Belegung, am 25. Juni 1966, vom damaligen münsterschen Weihbischof Heinrich Baaken.</p>',0,0,0,4,0,0,25,1,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',1,'0','',1,0,NULL,0,'','','',0,0,0,NULL,'',0,'',NULL,'','',NULL,124,0,0,0,0,NULL,'','','','default',NULL,'','',0,'','default','default','#FFFFFF','#333333','','',0,0,0,0,0,0,'none',0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"parallax\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"fade\">\n                    <value index=\"vDEF\">0</value>\n                </field>\n                <field index=\"filter\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>'),(43,'',4,1546087990,1546087684,2,0,0,0,0,'',128,0,0,0,0,NULL,0,'a:27:{s:5:\"CType\";N;s:6:\"colPos\";N;s:6:\"header\";N;s:13:\"header_layout\";N;s:15:\"header_position\";N;s:4:\"date\";N;s:11:\"header_link\";N;s:9:\"subheader\";N;s:33:\"tx_bootstrappackage_carousel_item\";N;s:11:\"pi_flexform\";N;s:6:\"layout\";N;s:11:\"frame_class\";N;s:18:\"space_before_class\";N;s:17:\"space_after_class\";N;s:22:\"background_color_class\";N;s:16:\"background_image\";N;s:24:\"background_image_options\";N;s:12:\"sectionIndex\";N;s:9:\"linkToTop\";N;s:16:\"sys_language_uid\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;s:10:\"categories\";N;s:14:\"rowDescription\";N;}',0,0,'',0,0,0,0,0,0,'carousel','','',NULL,0,0,0,0,0,0,0,2,0,0,0,'default',0,0,0,'','',NULL,NULL,0,'','',0,'0','',1,0,NULL,0,'','','',0,0,0,'<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"interval\">\n                    <value index=\"vDEF\">5000</value>\n                </field>\n                <field index=