INSERT INTO `tx_bootstrappackage_card_group_item` VALUES (1,1,1561976907,1539518788,1,0,0,0,0,3,0,0,'a:12:{s:6:\"header\";N;s:9:\"subheader\";N;s:5:\"image\";N;s:8:\"bodytext\";N;s:4:\"link\";N;s:10:\"link_title\";N;s:9:\"link_icon\";N;s:10:\"link_class\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,8,'Geschichte','Über 50 Jahre Haus Marienmünster in Schloss Holte-Stukenbrock',1,'<p>Das Haus Marienmünster ist vor allem durch die KAB von St. Marien Lenkerbeck in den 60-iger Jahren zu einem Selbstversorgerhaus ausgebaut worden. Seitdem steht die Einrichtung in einer engen Verbundenheit mit der Pfarrgemeinde – heute St. Franziskus Marl. Der Eigentümer ist der Förderverein „Lenkerbecker Erholungswerk Schloß Holte e.V.“</p>','','',0,'default'),(2,1,1561976907,1539636174,1,0,0,0,0,1,0,0,'a:1:{s:6:\"hidden\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,8,'Haupthaus','Über 37 Schlafplätze in Ein-, Zwei-, Vier- und Fünfbettzimmern.',1,'<p>Das Haupthaus&nbsp;verfügt über 37 Schlafplätze in Ein-, Zwei-, Vier- und Fünfbettzimmern und eignet sich besonders für Schulklassen oder Gruppen.<br /> Die Vier- und Fünfbettzimmer sind mit Etagenbetten ausgestattet.</p>','t3://page?uid=4','Mehr Informationen über unser Haupthaus',0,'primary'),(3,1,1561976907,1539636174,1,0,0,0,0,2,0,0,'a:1:{s:6:\"hidden\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,8,'Aussenanlage','Schwimmen, Grillen, Sport und Spiel ...',1,'<p>Im Außenbereich befinden sich weitere Sitzgelegenheiten auf der Terrasse sowie ein Schwimmbad, eine Grillhütte und eine große Sport- und Spielwiese, die für viel Spaß sorgen.</p>','t3://page?uid=5','Unsere große Aussenanlage',0,'default'),(4,1,1561976907,1539636174,1,0,0,0,0,4,0,0,'a:1:{s:6:\"hidden\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,8,'Lage','Die Umgebung entdecken',1,'<p>Eingebettet in die Weiten der Sennelandschaft, eine reizvolle Landschaft, in der es viel zu entdecken gibt, liegt Schloß Holte-Stukenbrock.</p>','t3://page?uid=7','Mehr zur schönen Lage des Hauses',0,'primary');
