INSERT INTO `tx_bootstrappackage_timeline_item` VALUES (1,3,1539718683,1539519346,1,0,0,0,0,0,0,'a:1:{s:6:\"hidden\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,9,'1965-11-01','Heinrich Bücker kommt als Religionslehrer nach Marl.','<p>Im November 1965 kam Heinrich Bücker, heute Pfarrer in Moers, als Religionslehrer nach Marl. Er war gleichzeitig Kaplan an der Kirche St. Marien in Marl-Lenkerbeck. Als Kaplan von Rheinhausen hatte er in seiner ostwestfälischen Heimat für Messdienerfreizeiten eine ehemalige Schule gemietet. Standort der Schule war der Ort Liemke, der heute zu Schloß Holte-Stukenbrock gehört. Als er Pfarrer Heithoff und der KAB von St. Marien Marl-Lenkerbeck von dem Haus erzählte, waren diese nach einer Besichtigung sofort interessiert, dieses Haus zu übernehmen, um ein Erholungsheim für Kinder daraus zu machen. Der zuständige Amtsdirektor von Werl, Klose, war mit der Übernahme einverstanden.</p>',0,0,0),(2,3,1539718683,1539519346,1,0,0,0,0,0,0,'a:1:{s:6:\"hidden\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,9,'1968-01-01','Gemeinde St. Marien Marl-Lenkerbeck kauft das Haus','<p>Das Haus wurde zunächst gemietet und 1968 von der Gemeinde St. Marien Marl-Lenkerbeck gekauft. Unter Leitung der Lenkerbecker KAB wurde das Haus instand gesetzt. An den Samstagen fuhren die zahlreichen&nbsp;Helferinnen und Helfer nach Schloß Holte, um an der ehemaligen Bauernschaftsschule ehrenamtlich zu arbeiten. Es herrschte stets eine tolle Stimmung. Häufig waren Pfarrer oder Kaplan dabei, die ebenfalls keine Renovierungsarbeiten scheuten. Am 10. Februar 1969 wurde dem Verein Lenkerbecker Erholungswerk von der Kirchengemeinde St. Marien per Grundstücks-Überlassungsvertrag, das Grundstück sowie die darauf stehenden Gebäude, (ausschließlich zur gemeinnützigen Nutzung) kostenlos überlassen.</p>',0,0,0),(3,3,1539718683,1539519346,1,0,0,0,0,0,0,'a:1:{s:6:\"hidden\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,9,'1966-06-25','Einweihung durch Weihbischof Heinrich Baaken','Eingeweiht wurde das Erholungsheim mit der ersten Belegung, am 25. Juni 1966, vom damaligen münsterschen Weihbischof Heinrich Baaken. ',0,0,0),(4,3,1539718683,1539519346,1,0,0,0,0,0,0,'a:1:{s:6:\"hidden\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,9,'1967-01-01','Bau des ersten Schwimmbeckens','<p>1967 wurde sogar ein Schwimmbecken gebaut. Die dafür benötigte Folie stiftete die „CWH“ (Chemische Werke Hüls AG), wie die heutige Degussa damals firmierte. Die erste Wasserfüllung wurde von der Schloßholter Feuerwehr geliefert. Das Wasser war eiskalt. Dennoch war Pfarrer Heithoff einer der ersten, der in das kalte Wasser stieg.<br /> &nbsp;</p>',0,0,0),(5,3,1539718683,1539718683,1,0,0,0,0,0,0,'a:9:{s:4:\"date\";N;s:6:\"header\";N;s:8:\"bodytext\";N;s:9:\"icon_file\";N;s:5:\"image\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,9,'1969-02-10','Lenkerbecker Erholungswerk erhält das Grundstück','<p>Am 10. Februar 1969 wurde dem Verein Lenkerbecker Erholungswerk von der Kirchengemeinde St. Marien per Grundstücks-Überlassungsvertrag, das Grundstück sowie die darauf stehenden Gebäude, (ausschließlich zur gemeinnützigen Nutzung) kostenlos überlassen.</p>',0,0,0),(6,3,1539718683,1539718683,1,0,0,0,0,0,0,'a:9:{s:4:\"date\";N;s:6:\"header\";N;s:8:\"bodytext\";N;s:9:\"icon_file\";N;s:5:\"image\";N;s:6:\"hidden\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:16:\"sys_language_uid\";N;}',0,0,0,'',0,0,0,0,0,0,NULL,9,'2006-09-02','40 Jähriges Jubiläum','<p>Am 2. September 2006 feierte das „Lenkerbecker Erholungswerk Schloß Holte e. V.“, das zur Pfarrgemeinde St. Marien in Marl-Lenkerbeck gehört, sein 40-jähriges Bestehen.</p>',0,0,0);
